import logo from './logo.svg';
import './App.css';
import {Route, Routes} from "react-router-dom";
import Artwork from "./pages/artwork";

function App() {
  return (
      <Routes>
        <Route path="artwork" element={<Artwork />} />
      </Routes>
  );
}

export default App;
